import React from "react";
import Part from "./Part";

const Content = (props) => {
  const parts = props.course.parts;
  return (
    <div>
      {parts.map((part) => (
        <Part key={id} part={part} />
      ))}
      <Part part={parts[0]} />
      <Part part={parts[1]} />
      <Part part={parts[2]} />
    </div>
  );
};

export default Content;
